import './App.css';
import CalendarHome from './components/homeEmployee/CalendarHome';
import MeetingStatus from './components/MeetingStatus/meetingStatus';
import { BrowserRouter as Router, Route, Routes, Link} from "react-router-dom";
function App() {
  return (
    <div className="App">
    <Router>
    <Routes>
    <Route path="/" component={<CalendarHome />} />
      <Route path="/meeting-status" component={<MeetingStatus />} />
        </Routes>
    </Router>
    </div>
  );

}

export default App;
